function TermsAndConditions() {
  return (
    <div className="tm">
      <h2>Términos y Condiciones</h2>
      <p>
        Fecha de última actualización: 30/07
      </p>

      <h3>Aceptación de los Términos</h3>
      <p>
        Al acceder y utilizar este sitio web www.innovex.es, aceptas regirte por estos Términos y Condiciones de uso. Si no estás de acuerdo con alguno de los términos establecidos aquí, por favor, no utilices este Sitio.
      </p>

      {/* Resto de los términos y condiciones */}

      <h3>Uso del Sitio</h3>
      <p>
        Estás autorizado a utilizar este Sitio solo con fines legales y de acuerdo con estos Términos. No debes utilizar este Sitio de manera que pueda dañar, deshabilitar, sobrecargar o deteriorar el Sitio o interferir con el uso y disfrute de este Sitio por parte de terceros.
      </p>
      {/* Resto de los términos y condiciones */}

      <h3>Propiedad Intelectual</h3>
      <p>
        Los contenidos, diseños, logotipos, imágenes, gráficos, y otros elementos del Sitio están protegidos por leyes de propiedad intelectual y no pueden ser utilizados sin el consentimiento expreso del titular de los derechos.
      </p>
      {/* Resto de los términos y condiciones */}

      <h3>Limitación de Responsabilidad</h3>
      <p>
        Este Sitio se proporciona "tal cual" y no ofrecemos garantías de ningún tipo, expresas o implícitas, sobre la exactitud, integridad o disponibilidad de los contenidos. No seremos responsables por ningún daño directo, indirecto, incidental, consecuente o especial que surja del uso o la incapacidad de utilizar este Sitio.
      </p>
      {/* Resto de los términos y condiciones */}

      <h3>Cambios en los Términos</h3>
      <p>
        Nos reservamos el derecho de modificar estos Términos en cualquier momento. Cualquier cambio será efectivo desde el momento de su publicación en este Sitio. Se recomienda revisar periódicamente los Términos para estar informado de las actualizaciones.
      </p>
      {/* Resto de los términos y condiciones */}

      <h3>Contacto</h3>
      <p>
        Si tienes preguntas o inquietudes sobre estos Términos y Condiciones, puedes contactarnos a través de [correo electrónico de contacto].
      </p>
      {/* Resto de los términos y condiciones */}
    </div>
  );
}

export default TermsAndConditions;
